def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    # validate the axis parameter
    if axis not in [0, 1]:
        raise ValueError("axis must be 0 or 1")

    if axis == 0:
        # group along the index (rows)
        return obj.groupby(key, axis=0, level=level, sort=sort, observed=observed)

    # group along the columns
    if key is None:
        raise ValueError("No group keys passed")

    if isinstance(key, (str, tuple)):
        key = [key]

    if isinstance(key, list):
        if all(col in obj.columns for col in key):
            # all keys are valid column names
            column_group = obj[key].sum(axis=1)
            return column_group
        else:
            raise KeyError("One or more of the specified keys are not valid column names")

    raise ValueError("Invalid key for groupby on columns")
